```javascript
const dict = {
  "apple": 3,
  "banana": 2,
  "orange": 1,
  "grape": 4,
  "kiwi": 5,
  "mango": 6
};

const sortedKeys = Object.keys(dict).sort();

for (let key of sortedKeys) {
  console.log(`${key}: ${dict[key]}`);
}
```

Output:
	apple: 3
	banana: 2
	grape: 4
	kiwi: 5
	mango: 6
	orange: 1
```

We first get the keys of the dictionary using `Object.keys()` method and then we sort them alphabetically using `.sort()`. We can then loop through the sorted keys to output the values in the desired order.
